// pages/game/game.js
Page({
  data: {
    directionImgUrl: '../../images/direction.png',
    directionImgUrl_press: '../../images/direction_press.png',
    isPressUp: false,
    isPressDown: false,
    isPressLeft: false,
    isPressRight: false,
    hero: {
      speed: 256,
      x: 0,
      y: 0
    },
    monster: {
      x: 0,
      y: 0
    },
    monstersCaught: 0,
    
  },
  onLoad: function (options) {
    // 页面初始化 options为页面跳转所带来的参数
  },
  onReady: function (e) {
    var that = this;
    console.log(that.data.hero.x)
    
    // 使用 wx.createContext 获取绘图上下文 context
    var ctx = wx.createContext()

    // 画出所有物体
    var render = function () {

      ctx.drawImage('data:image/png;base64,', 0, 0)


      ctx.drawImage('data:image/png;base64,', that.data.hero.x, that.data.hero.y);



      ctx.drawImage('data:image/png;base64,', that.data.monster.x, that.data.monster.y);

      //计分
      ctx.fillStyle = 'rgb(250,250,250)';
      ctx.font = '24px Helvetica';
      ctx.textAlign = 'left';
      ctx.textBaseline = 'top';
      ctx.fillText('monstersCaught:' + that.data.monstersCaught, 32, 32);


    }
    //当用户抓住一只怪物后开始新一轮游戏
    var reset = function () {
      that.setData({
        'hero.x' : 200, 
        'hero.y' : 190,

        // 将新的怪物随机放置到界面上
        'monster.x' : 32 + (Math.random() * (400 - 64)),
        'monster.y' : 32 + (Math.random() * (375 - 64))
      })
      
    };

    // 游戏主题函数
    var main = function(){
      var now = Date.now();
      var delta = now - then;

      //update(delta/1000);
      render();

      then = now;

      // 立即调用主函数
      //requestAnimationFrame(main);
      
    }
    var then = Date.now();
    reset();
    main();

    // 调用 wx.drawCanvas，通过 canvasId 指定在哪张画布上绘制，通过 actions 指定绘制行为
    wx.drawCanvas({
      canvasId: 'canvas',
      actions: ctx.getActions() // 获取绘图动作数组
    })
  },
  directionTouchStart(e) {
    console.log(e.currentTarget.id);
    var heroUp = this.data.hero.y -this.data.hero.speed/50;
    var heroDown = this.data.hero.y + this.data.hero.speed/50;
    var heroLeft = this.data.hero.x -this.data.hero.speed/50;
    var heroRight = this.data.hero.x + this.data.hero.speed/50;
    switch (e.currentTarget.id) {
      case 'up': this.setData({
        isPressUp: true,
        'hero.y':heroUp
      });
        break;
      case 'down': this.setData({
        isPressDown: true,
        'hero.y':heroDown
      });
        break;
      case 'left': this.setData({
        isPressLeft: true,
        'hero.x':heroLeft
      });
        break;
      case 'right': this.setData({
        isPressRight: true,
        'hero.x':heroRight
      });
        break;
    };
    this.run();
  },
  directionTouchEnd(e) {
    console.log(e.currentTarget.id)
    switch (e.currentTarget.id) {
      case 'up': this.setData({
        isPressUp: false
      })
        break;
      case 'down': this.setData({
        isPressDown: false
      })
        break;
      case 'left': this.setData({
        isPressLeft: false
      })
        break;
      case 'right': this.setData({
        isPressRight: false
      })
        break;
    }
  },
  run(){
    var that = this;
    
    // 使用 wx.createContext 获取绘图上下文 context
    var ctx = wx.createContext()
     //当用户抓住一只怪物后开始新一轮游戏
    var reset = function () {
      that.setData({
        'hero.x' : 200, 
        'hero.y' : 190,

        // 将新的怪物随机放置到界面上
        'monster.x' : 32 + (Math.random() * (400 - 64)),
        'monster.y' : 32 + (Math.random() * (375 - 64))
      })
      
    };
    // 画出所有物体
    var render = function () {

      ctx.drawImage('data:image/png;base64,', 0, 0)


      ctx.drawImage('data:image/png;base64,', that.data.hero.x, that.data.hero.y);



      ctx.drawImage('data:image/png;base64,', that.data.monster.x, that.data.monster.y);

      //计分
      ctx.fillStyle = 'rgb(250,250,250)';
      ctx.font = '24px Helvetica';
      ctx.textAlign = 'left';
      ctx.textBaseline = 'top';
      ctx.fillText('monstersCaught:' + that.data.monstersCaught, 32, 32);


    }
    // 英雄与怪物碰到了么？
    if (
        this.data.hero.x <= (this.data.monster.x + 32)
        && this.data.monster.x <= (this.data.hero.x + 32)
        && this.data.hero.y <= (this.data.monster.y + 32)
        && this.data.monster.y <= (this.data.hero.y + 32)
    ) {
        ++this.data.monstersCaught;
        reset();
    }
    render()

    // 调用 wx.drawCanvas，通过 canvasId 指定在哪张画布上绘制，通过 actions 指定绘制行为
    wx.drawCanvas({
      canvasId: 'canvas',
      actions: ctx.getActions() // 获取绘图动作数组
    })
  }
})